import React,{useState} from 'react'

function UseReducer() {
    const [count, setCount] = useState(0);
  return (
    <>
     <h1>hello reducer</h1> 
     
     <h2>Count:{count}</h2>
    <button onClick={() => setCount(count + 1)}>INCREMENT Count</button>
    <button onClick={() => setCount(count - 1)}>DECREMENT Count</button>
    </>
  )
}

export default UseReducer
